roi.description:
可选, ROI区域.
- 对于使用多边形作为区域的事件, 一般传入至少4个点, 顺时针方向, 不要求闭合, 不填或置空表示全画面;
- 对于跨线事件, 必须传入两个点表示参考线, 建议参考线尽量穿过画面中部区域, 以达到更好的检测效果;
- 各点的坐标为画面下的百分比坐标(如顶点<x=0.1, y=0.1>可以表示1920x1080分标率画面下<x=192,y=108>的点), 前后端根据实际分辨率进行换算.

device_id.description:
可选, 摄像机硬件id.
- GB28181平台相机时为相机国标ID;
- GAT1400平台相机时为相机DeviceID(APE_ID);
- 其他平台接入时为对应平台下相机的ID;
- 直连相机时为相机host信息, 格式:"ip:port".

source_id.description:
可选, 内部自动生成, 用于表示GAT1400的SourceID.
- 第三方视图库推图给VIPER IIS时携带, 然后由IIS填入;
- GB28281视频流提取的图片经IIS推送给第三方视图库时由IIS生成.

rtsp.description:
RTSP协议参数.

任务下发范例(默认端口30080)：curl -XPOST http://${viper-service}:30080/engine/video-ingress/v1/generate_rtsp_address -d '
{
   "source_info":
   {
       "source_id":
       {
          "region_id": 20,
          "camera_idx": 49
       },
       "source":
       {
          "type": "VN_RTSP",
          "parameter":
          {
             "rtsp":
             {
                "url":"rtsp://184.72.239.149/vod/mp4:BigBuckBunny_115k.mov",
                "protocol_type":"UDP"
             }
          }
       }
    }
}'

将生成的完整RTSP地址(格式: rtsp://someservice:554/urlbase64Encoded), 通过vps命令下发：
详情请参考: http://gitlab.sz.sensetime.com/viper/engine-video-process-service/blob/master/pb/engine-video-process-service.proto.

