type.description:
相机接入类型.
SourceType关联的parameter如下:
- FaceCameraParameter对应类型: FC_XXX, FP_XINGHUO;
- GAT1400PlatformCameraParameter对应类型: FP_XXX_PLATFORM;
- RTSPParameter对应类型: VN_RTSP;
- GB28181PlatformCameraParameter对应类型: VP_GB28181_STD;
- NVRParameter对应类型: VP_ALIYUN;
- OnvifParameter对应类型: VN_ONVIF;
- XinHuoPlatformCameraParameter对应类型: VP_XINGHUO.

commonapisOrientation.description:
设备物理朝向坐标系 [SINCE v2.1.0].
使用右手坐标系, 在设备坐标系中. 
Z轴为镜头光轴, 即镜头朝向方向为正方向;
Y轴正方向为摄像机底部到摄像机顶部;
X轴正方向为Y与Z叉积方向.

urls.description:
分片处理结果下载URL, URL为HDFS的目录，可通过HTTPFS接口下载该目录下的文件.
* 对COMPARISON类型, 输出为每行一个ComparisonResult的JSON表示.
  结果可以参考下面的json.
  ```json
   {
     "source": {
       "id": "de32206c79ae4aaf88f588852812f006000000000020dfee",
       "seq_id": 2154478
     },
     "targets": [
       {
         "id": "de32206c79ae4aaf88f588852812f006000000000020dfee",
         "seq_id": 2154478
       }
     ],
     "scores": [
       0.999932587146759
     ]
   }
  ```
* 对CLUSTERING类型, 输出为每行一个ClusteringResult的JSON表示.
  结果可以参考下面的json.
  ```json
  {
    "cluster_id": 1,
    "targets": [
      {
        "source": {
          "db_type": 0,
          "db_id": "f2dc84fe-461c-4bc4-b279-760d58fff000"
        },
        "item": {
          "id": "f2dc84fe461c4bc4b279760d58fff001000000000110fa4d",
          "seq_id": 17889869
        }
      }
    ]
  }
  ```
其中cluster_id在本次结果中唯一，不连续.
